gDZ(){return"I discovered a passion for Flutter in 2020, becoming a Full-Stack professional capable of developing mobile applications from scratch to the final product. At Exacology, I worked as an Android developer, taking on Senior-level responsibilities after their departure. I am now seeking new opportunities to apply my skills in challenging projects."},
