gNE(){return"In the project, I developed the front-end following the principles of clean code and the MVC/MVVM architecture. My responsibilities included planning and executing complex functionalities, as well as proposing technological improvements for the system. I acted as the development coordinator, working closely with the backend team, designer, and product manager. We used version control tools like Git and adopted agile methodologies, such as Scrum.\nThe application had three main sections: a Chat, a psychological test area, and lists of users in various categories, providing users with a way to assess their connections beyond initial appearances. The functionality of blurring the photo after a specific number of interactions was implemented to encourage evaluations based on deeper criteria."},
